# 使用正则表达式匹配整句话中括号内倒数第二、第三和第四个数字
pattern = r"^\(nd TRF \(SLT (?:[-\d.]+\s+){12}[-.\d]+\s+[-.\d]+\s+[-.\d]+\)\(nd StaticMesh \(setVisible 1\) \(load models/soccerball.obj\) \(sSc 0.042 0.042 0.042\) \(resetMaterials soccerball_rcs-soccerball.png\)\)$"

match = re.search(pattern, message)

if match:
    # 提取匹配的三个数字
    x = float(match.group(1))
    y = float(match.group(2))
    z = float(match.group(3))

    # 打印提取的信息
    print(f"坐标: x={x}, y={y}, z={z}")
else:
    print("未找到匹配的内容")
